kGLMM_DuplicatedRepeatedLevelForCaseWeight.LABEL=Niekt\u00f3re prawid\u0142owe wagi liczebno\u015bci s\u0105 wi\u0119ksze ni\u017c 1, dlatego poziomy efektu powtarzanych pomiar\u00f3w nie s\u0105 r\u00f3\u017cne dla poszczeg\u00f3lnych obserwacji w powtarzanym obiekcie.
kGLMM_UndistinctDependentDataInBinomial.LABEL=Zmienna przewidywana musi zawiera\u0107 dwie r\u00f3\u017cne prawid\u0142owe warto\u015bci danych, gdy u\u017cywany jest rozk\u0142ad dwumianowy.
kGLMM_IllegalDependentValInGammaOrIGauss.LABEL=Przewidywane warto\u015bci danych dla rozk\u0142adu prawdopodobie\u0144stwa {0} musz\u0105 by\u0107 dodatnie.
kGLMM_IllegalDependentValInNebinomialOrPoisson.LABEL=Przewidywane warto\u015bci danych dla rozk\u0142adu prawdopodobie\u0144stwa {0} musz\u0105 by\u0107 nieujemnymi liczbami ca\u0142kowitymi.
kGLMM_InvalidInitialValue.LABEL=B\u0142\u0105d: Lista lub plik warto\u015bci wst\u0119pnych zawiera nieprawid\u0142owe lub niedostateczne dane. Nale\u017cy okre\u015bli\u0107 warto\u015bci wst\u0119pne dla wszystkich parametr\u00f3w (\u0142\u0105cznie z nadmiarowymi parametrami w przypadku uog\u00f3lnionego modelu liniowego). Uporz\u0105dkowanie warto\u015bci wst\u0119pnych powinno by\u0107 zgodne z porz\u0105dkiem parametr\u00f3w modelu u\u017cywanych przez procedur\u0119.
kGLMM_IterationTerminatedButNoConv.LABEL=Iteracja zosta\u0142a zako\u0144czona, jednak nie uzyskano zbie\u017cno\u015bci. Wy\u015bwietlane s\u0105 dane wyj\u015bciowe ostatniej iteracji. Procedura jest kontynuowana pomimo tego ostrze\u017cenia. Kolejne uzyskane rezultaty s\u0105 oparte na ostatniej iteracji. Prawid\u0142owo\u015b\u0107 dopasowania modelu jest niepewna.
kGLMM_ConvButHessianNotPositive.LABEL=Ostateczna macierz Hessego nie jest okre\u015blona dodatnio, mimo \u017ce wszystkie kryteria zbie\u017cno\u015bci s\u0105 spe\u0142nione. Procedura jest kontynuowana pomimo tego ostrze\u017cenia. Kolejne uzyskane rezultaty s\u0105 oparte na ostatniej iteracji. Prawid\u0142owo\u015b\u0107 dopasowania modelu jest niepewna.
kGLMM_QuasiCompleteSeparation.LABEL=Mo\u017ce wyst\u0105pi\u0107 pseudokompletna separacja w danych. Estymacje metod\u0105 najwi\u0119kszej wiarygodno\u015bci nie istniej\u0105. Procedura jest kontynuowana pomimo tego ostrze\u017cenia. Kolejne uzyskane rezultaty s\u0105 oparte na ostatniej iteracji. Prawid\u0142owo\u015b\u0107 dopasowania modelu jest niepewna.
kGLMM_InvalidCaseInLastIteration.LABEL=Istnieje co najmniej jeden nieprawid\u0142owy rekord w ostatniej iteracji. Rekord jest nieprawid\u0142owy, je\u017celi w procesie iteracyjnym wyst\u0105pi\u0142y b\u0142\u0119dy podczas obliczania odwr\u00f3conej funkcji \u0142\u0105czenia {0}, logarytmu wiarygodno\u015bci, gradientu lub macierzy Hessego. \u017badne dane wyj\u015bciowe nie zostan\u0105 przedstawione.
kGLMM_FrequencyWeightVarInCovariate.LABEL=Waga liczebno\u015bci nie mo\u017ce by\u0107 wykorzystana w innej roli.
kGLMM_VarInFixedEffectCanNotBeAnalysisWeightOrOffset.LABEL=Zmienna nie mo\u017ce by\u0107 okre\u015blona jako cz\u0119\u015b\u0107 efektu sta\u0142ego i {0}.
kGLMM_VarInRandomEffectCanNotBeAnalysisWeightOrOffset.LABEL=Zmienna nie mo\u017ce by\u0107 okre\u015blona jako cz\u0119\u015b\u0107 efektu losowego i {0}.
kGLMM_DuplicatedFactorInEffect.LABEL=Zmienna kategorialna zosta\u0142a okre\u015blona wi\u0119cej ni\u017c jeden raz w efekcie. Mo\u017ce by\u0107 okre\u015blona tylko jeden raz.
