kGLMM_TargetIsNotCatForMultinomial.LABEL=Obiekt docelowy musi mie\u0107 jako\u015bciowy poziom pomiaru, je\u017celi okre\u015blono wielomianowy rozk\u0142ad prawdopodobie\u0144stwa.
kGLMM_TargetIsNotContForSomeDistribution.LABEL=Zmienna przewidywana musi mie\u0107 ilo\u015bciowy poziom pomiaru, je\u017celi okre\u015blono rozk\u0142ad prawdopodobie\u0144stwa {0}.
