kGLMM_ResGroupingWhileNoRepMeasure.LABEL=Nie okre\u015blono zmiennej powtarzanych pomiar\u00f3w, dlatego cz\u0119\u015b\u0107 modelu zwi\u0105zana z powtarzanymi pomiarami nie zosta\u0142a utworzona.
kGLMM_EMMeansHasContinuousFieldInEffect.LABEL=Wszystkie sk\u0142adniki estymowanych \u015brednich brzegowych musz\u0105 by\u0107 zmiennymi kategorialnymi.
kGLMM_EMMeansEffectIsMoreThan3Ways.LABEL=Maksymalnie trzy zmienne mo\u017cna okre\u015bli\u0107 w pojedynczym sk\u0142adniku estymowanych \u015brednich brzegowych.
kGLMM_EMMeansContrastFieldIsNotInEffect.LABEL=Zmienna kontrastu musi by\u0107 r\u00f3wnie\u017c sk\u0142adnikiem w specyfikacji estymowanych \u015brednich brzegowych.
