kGLMM_NoValidCasesForSpecifiedLinkFunction.LABEL=Brak prawid\u0142owych rekord\u00f3w dla funkcji \u0142\u0105czenia {0}. \u017badne dane wyj\u015bciowe nie zostan\u0105 przedstawione.
kGLMM_RMatrixIsNotPositiveInIteProcess.LABEL=Macierz kowariancji reszt nie zosta\u0142a dodatnio okre\u015blona w procesie iteracyjnym. \u017badne dane wyj\u015bciowe nie zostan\u0105 przedstawione.
