kGLMM_GMatrIsNotPositive.LABEL=Estymowana macierz kowariancji efekt\u00f3w losowych (macierz G) nie jest pozytywnie okre\u015blona. Procedura jest kontynuowana pomimo tego ostrze\u017cenia. Kolejne uzyskane rezultaty s\u0105 oparte na ostatniej iteracji. Prawid\u0142owo\u015b\u0107 dopasowania modelu jest niepewna.
kGLMM_CompleteSeparation4BinomialAndNominal.LABEL=Mo\u017ce wyst\u0105pi\u0107 kompletna separacja w danych. Estymacje metod\u0105 najwi\u0119kszej wiarygodno\u015bci nie istniej\u0105. Procedura jest kontynuowana pomimo tego ostrze\u017cenia. Kolejne uzyskane rezultaty s\u0105 oparte na ostatniej iteracji. Prawid\u0142owo\u015b\u0107 dopasowania modelu jest niepewna.
