kGLMM_RepeatMeasureIsNotDefinedForSpatialCovariance.LABEL=Dla typu kowariancji przestrzennej "{0}" nie zosta\u0142y zdefiniowane zmienne powtarzanych pomiar\u00f3w. Dla typu kowariancji przestrzennej wymagana jest co najmniej jedna zmienna powtarzanych pomiar\u00f3w. W tej sytuacji proces u\u017cyje typu kowariancji "ID".
kGLMM_ZeroDistancesInCorSpatial.LABEL=W macierzy przestrzennej istnieje warto\u015b\u0107 o odleg\u0142o\u015bci zerowej. By\u0107 mo\u017ce dla innego rekordu istnieje ta sama warto\u015b\u0107 c-list.
kGLMM_OneRecordInOneCombinationOfSubjectAndGroup.LABEL=W danych istnieje tylko jeden rekord w kombinacji obiektu i grupy.
kGLMM_CovStructChangeToUnstructureAsRepeatedBEffHasOneLevel.LABEL=Struktura kowariancji jest zmieniana na nieustrukturyzowan\u0105, poniewa\u017c zmienna powt\u00f3rzona B ma tylko jeden poziom.
kGLMM_CovStructChangeToUnstructureAsRepeatedNotEqualTwo.LABEL=Struktura kowariancji jest zmieniana na nieustrukturyzowan\u0105, poniewa\u017c liczba zmiennych powt\u00f3rzonych nie jest r\u00f3wna 2.
kGLMM_RobustChangeModelAsRepeatedKR.LABEL=Poniewa\u017c zosta\u0142a wybrana metoda Kenwarda-Rogera, metoda kowariancji odpornej jest zmieniana na metod\u0119 kowariancji opartej na modelu.
kGLMM_CovStructChangeToUnstructureAsOnlyReppeatedOrKroneck.LABEL =Struktura kowariancji jest zmieniana na nieustrukturyzowan\u0105, poniewa\u017c nie okre\u015blono zmiennych pomiaru Kroneckera.
kGLMM_SameReppeatedandKronecker.LABEL=Listy powt\u00f3rzonego pomiaru i pomiaru Kroneckera s\u0105 takie same dla wybranej struktury kowariancji. Dopasowanie modelu mo\u017ce nie by\u0107 odpowiednie.
kGLMM_ErrorInSettingForKroneckerType.LABEL=Powt\u00f3rzony pomiar i pomiar Kroneckera s\u0105 okre\u015blone, ale typ kowariancji \u201e{0}\u201d nie jest typu Kroneckera.

